import React from "react";

const HeroSection = () => {
  return (
    <>
      {/* Header Section */}
      <header className="text-center">
        <h1 className="text-xl md:text-8xl font-sans font-bold mb-4">
          Your Store{" "}
        </h1>
        <h1 className="text- md:text-8xl font-bold bg-clip-text bg-gradient-to-r from-pink-500 to-blue-500">
          AI Ready
        </h1>
        <p className="text-lg md:text-xl text-gray-300">
          An OS that makes your brand generate, personalize and sell better to
          your customers.
        </p>
      </header>

      {/* Upload Section */}
      <div className="mt-8 w-full max-w-md">
        <div className="flex items-center bg-gray-800 rounded-lg p-4">
          <form className="flex flex-col font-sans font-medium rounded-lg p-2 w-full box-border">
            <input type="hidden" />
            <input
              type="text"
              id="moviename"
              name="moviename"
              placeholder="Generate a photorealistic image male model"
              required
              autoComplete="off"
              className="w-full text-base font-sans mb-2 border-none bg-transparent rounded-md box-border outline-none text-white"
            />
          </form>
          <label
            htmlFor="upload-image"
            className="text-gray-400 cursor-pointer flex-1"
          >
            Upload Image
          </label>
          <button className="bg-gradient-to-r from-purple-600 to-pink-500 text-white py-2 px-4 rounded-md">
            Generate
          </button>
        </div>
      </div>

      {/* Features Section */}
      <div className="flex flex-wrap justify-center mt-12 gap-4">
        <button className="bg-gray-800 text-gray-300 py-2 px-6 rounded-lg hover:bg-gray-700">
          Product Research
        </button>
        <button className="bg-gray-800 text-gray-300 py-2 px-6 rounded-lg hover:bg-gray-700">
          Photoshoots & Images
        </button>
        <button className="bg-gray-800 text-gray-300 py-2 px-6 rounded-lg hover:bg-gray-700">
          Storefront Optimizations
        </button>
      </div>
    </>
  );
};

export default HeroSection;

